import React, { useState } from 'react'

function TextInput() {
  const [text, setText] = useState('...')

  const textUpdate = (event) => {
    let text = ''
    text = event.target.value
    setText(text)
  }

  return (
    <div>
      <p>Input: {text}</p>
      <input placeholder="Serch" onChange={textUpdate} />
    </div>
  )
}

export default TextInput
